  \"Kenai Peninsula Brown Bear Studies : Report of the Interagency Brown Bear Study
  Team, 1986\",\n\t\"tracking_summary\": {\n\t\t\"total\": 18,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
