  \"kenai-peninsula-brown-bear-studies-report-of-the-interagency-brown-bear-study-team-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes work conducted during
  the 1986 field season on brown bear (Ursus arctos) from the Kenai Peninsula, Alaska.
  Ground surveys were conducted to assess food presence and abundance in two areas
  where radio collared bears where relocated. Surveys were also conducted in two areas
  surveyed in previous field seasons in order to compare brown bear use on a seasonal
  basis. One salmon stream was surveyed to determine the extent of use by brown bears
  during the salmon runs. Two areas were surveyed to select potential trap sites.
  Aerial tracking and snaring efforts were successful and should be considered for
  future study efforts. A user survey on the Russian River/Resurrection River/Cooper
  Lake trail system indicated use in this area by recreationists was similar to use
  in 1985.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
